svg.script:
function init(evt) { if ( window.svgDocument == null ) svgDocument = evt.target.ownerDocument; }
function fmtT(val, div) {
 if (div > 100) return Math.floor(val*div/32) + " ms";
if (div > 0.025) return Math.floor(val*div*1000/32)/1000 + " ms";
 return Math.floor(val*div*1000*1000/32)/1000 + " us";
}
function fmtU(val, div, shift) { return Math.floor((shift-val)*div/32) + " mV"; }
function msMove (evt)
{
	var x = evt.clientX;
	var y = evt.clientY;
	if (x < 0 || y < 0 || x >= 4096 || y >= 256)
		return;
	var hscroll = (document.all ? document.scrollLeft : window.pageXOffset);
	var width = window.innerWidth;

	svgDocument.getElementById("CH1").setAttribute("x", hscroll+20);
	svgDocument.getElementById("CH2").setAttribute("x", hscroll+20);
	svgDocument.getElementById("CH1s").setAttribute("x", hscroll+width-20);
	svgDocument.getElementById("CH2s").setAttribute("x", hscroll+width-20);

	svgDocument.getElementById("CH1").firstChild.data = "CH1: "+fmtU(y, 1000.000, 157) + " " + fmtT(x, 0.049);
	svgDocument.getElementById("CH2").firstChild.data = "CH2: "+fmtU(y, 500.000, 223) + " " + fmtT(x, 0.049);
}
